import { Carousel } from 'antd'
import React from 'react'
import styled from 'styled-components'
import WordCard from '../components/Main/WordCard'

const MyCarousel = styled(Carousel)`
  > .slick-dots-bottom li button:before {
    width: 6px;
    height: 6px;
  }
`

const Cards = styled.div`
  background-color: #f9fafb;
  height: 200px;
  padding-bottom: 5%;
  padding-top: 5%;
  padding-left: 5%;
  padding-right: 5%;
`

function onChange(a, b, c) {
  console.log(a, b, c)
}

const contentStyle = {
  height: '160px',
  color: '#fff',
  lineHeight: '160px',
  textAlign: 'center',
  background: '#364d79',
}

function Main() {
  return (
    <>
      <WordCard />
      <MyCarousel afterChange={onChange}>
        <div>
          <h3 style={contentStyle}>1</h3>
        </div>
        <div>
          <h3 style={contentStyle}>2</h3>
        </div>
        <div>
          <h3 style={contentStyle}>3</h3>
        </div>
        <div>
          <h3 style={contentStyle}>4</h3>
        </div>
      </MyCarousel>
    </>
  )
}

export default Main
